import React, { Component, Fragment } from 'react';
import { Container } from 'react-bootstrap';

class Search extends Component {
    render() {
        return (
            <Fragment>
                <Container fluid={true} className="text-center searchBack">
                    <div>
                    <h1 className="searchTitle">Your Health is Our Priority</h1>
                    <h5 className="searchDes">Exercitation voluptate laboris laborum nulla quis dolor</h5>
                    <button>Search Places</button>
                    </div>
                </Container>
            </Fragment>
        );
    }
}

export default Search;
